class Solution {
    func minOperations(_ nums1: [Int], _ nums2: [Int]) -> Int {
        let n = nums1.count
        var ops = 0

        var nums1 = nums1
        var nums2 = nums2

        // Ensure last elements are maximums
        let maxNum1 = nums1.max()!
        let maxNum2 = nums2.max()!

        if nums1[n-1] != maxNum1 || nums2[n-1] != maxNum2 {
            for i in 0..<n {
                if nums1[i] == maxNum1 && nums2[i] == maxNum2 {
                    // Swap to make the last elements max if they are not already
                    (nums1[i], nums2[i]) = (nums2[i], nums1[i])
                    ops += 1
                    if nums1[n-1] == maxNum1 && nums2[n-1] == maxNum2 {
                        return ops
                    }
                }
            }
            // Check after all possible swaps
            if nums1[n-1] == maxNum1 && nums2[n-1] == maxNum2 {
                return ops
            } else {
                // If still not satisfied, then it's not possible
                return -1
            }
        }

        // If initial arrays already satisfy the condition
        return 0
    }
}
